function PageContainer() {

 useEffect(fetchInfo, [])
    function fetchInfo(){
      fetch(infoUrl)
      .then(r=>r.json())
      .then()
    }

    return (
    <>
        <Home />
        <Discography />
        <TourSchedule />
    </>
  );
}

export default PageContainer;
